import React from "react";
import Contact from "./Contact";
import { Link } from "react-router-dom";

const MealSearch = () => {
    return(
        <Contact>
            <h1>Meal Search</h1>
            <Link to={`/mealdetails/${meal.strMeal}`}>
                <h3>{meal.strMeal}</h3>
                <img src={meal.strMealThumb} alt={meal.strMeal} />
            </Link>
        </Contact>
    )
}
export default MealSearch
